import React from 'react';
import styles from './index.module.css';

const Login = () => {
  return (
    <div>
        <h2>LOGIN</h2>
        <form action="">
            <input type="email" placeholder='E-MAIL'/>
            <input type="password"  placeholder='PASSWORD'/>
            <button>
                SUBMIT
            </button>
        </form>
    </div>
  )
}

export default Login
